  true,\n\t\"url\": null,\n\t\"notes\": \"<p>The Office of Child Care Report to Congress
  is required by Section 658L of the Child Care and Development Block Grant Act as
  amended by the Personal Responsibility and Work Opportunity Reconciliation Act (PRWORA)
  of 1996 (P.L. 104u2013193) and the Balanced Budget Act of 1997 (P.L. 105u201333).
  The report describes and analyzes current information about the Child Care and Development
  Fund (CCDF) from a variety of sources, including State plans, expenditure reports,
  administrative data reports, and research. The report also includes information
  about training and technical assistance that is provided to States, Territories,
  and Tribes.</p>n\",\n\t\"owner_org\": \"3609164c-4c49-4a44-9179-23163027dc0a\",\n\t\"extras\":
